import './App.css';
import Banner from './components/Banner';
import Destination from './components/Destination';
import data from '../data'

function App() {
  data.map(item => <Destination id={data.id} image={data.image} location={data.location} link={data.link} atraction={data.atraction} date={data.date} description={data.description} />);
  return (
    <div className="App">
      <Banner />
      <Destination />
    </div>
  );
}

export default App;
